    const stickyButton = document.getElementById('stickyTapToCall');
    const chatClick = document.getElementsByClassName('chat-btn')[0];
    var heroTapButton = document.getElementById('tapToCallQuoteBtn')
    var notStuck = true;
    var stickingPoint = 0;

    function atBottom(element){
        var edge = element.getBoundingClientRect();
        return edge.bottom;
    }

    function stopSticky(){
        if (notStuck){
            if(atBottom(heroTapButton) <= 125){
                stickyButton.style.height = '101px';
                stickyButton.style.padding = "22px 27px"
                chatClick.style.bottom = '115px';
                notStuck = false;
                stickingPoint = window.scrollY;
            } 
        }
        if(stickingPoint > window.scrollY){
            stickyButton.style.height = '0';
            stickyButton.style.padding = "0px"
            chatClick.style.bottom = '15px';
            notStuck = true;
            stickingPoint = 0;
        }

        }
