let entries = null;
if (data != undefined){
    entries = Object.values(data);
}

let petName = null;
for (let i = 0; i < entries.length; i++) {
  if (entries[i].name === "PetName") {
    petName = entries[i].value;
    if (petName != null){
        petName = petName.split(' ').map(word => word.charAt(0).toUpperCase() + word.slice(1)).join(' ');
    }
    break;
    }
}

function changeThings(){    
    let headline = document.querySelector('h1');
    if (petName != null && headline){
        headline.textContent = petName+"'s 30 day offer is ending, continue coverage today!";
    } else if (!petName && headline){
        headline.textContent = "Your pet's 30 day offer is ending, continue coverage today!";
    }
    if (headline){
        clearInterval(checkForChanges);
    } 
}

const checkForChanges = setInterval(changeThings, 100);
